INSERT INTO `xh_news` VALUES
('1','系统消息','<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;, Verdana, Arial, SimSun; font-size: medium; white-space: normal; background-color: rgb(245, 245, 245);\">任务管理系统已部署到位，使用时请注意下面三个问题：</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;, Verdana, Arial, SimSun; font-size: medium; white-space: normal; background-color: rgb(245, 245, 245);\">1、教师用户名为姓名的首写字母(大小写不区分)，如郭盛为gs，密码默认为123456；</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;, Verdana, Arial, SimSun; font-size: medium; white-space: normal; background-color: rgb(245, 245, 245);\">2、学生用户名为班级编号(六位)+班级序号（两位），需教师在第一次发布任务后参照学生完成列表告诉学生，密码默认为123456；</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;, Verdana, Arial, SimSun; font-size: medium; white-space: normal; background-color: rgb(245, 245, 245);\">3、若在使用中遇到问题，请及时联系计算机教研室郭老师解决，电话：18993351660。</p><p><br/></p>','1','','admin','1505655674');-- <xjx> --
